import logo from "./logo.svg";
import "./App.css";
import Home from "./Pages/Home";
import LoginPage from "./Pages/LoginPage";

function App() {
  return (
    <div className="App">
      <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/login" component={LoginPage} />
      </Switch>
    </Router>
    </div>
  );
}

export default App;
